import './App.css';
import Header from './components/header';
import Menu from './components/menu';
import Show from './components/Show_product';
import Footer from './components/footer';
import Admin from './Admin/Admin';
function App() {
  return (
    <div>
         <Header/>
        <Router>
      <div className="App">
        <Menu />
      </div>
    </Router>
         <Show/>
         <Admin/>
         <Footer/>
    </div>

  );
}

export default App;
